import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import { AuthProvider } from './pages/AuthContex';

const root = ReactDOM.createRoot(document.querySelector('#root'));
root.render(
    <AuthProvider>
        <App />
    </AuthProvider>
);
